          "title": "Gartenhaus in Stuttgart",
          "text": "<p align=\"left\" style=\"margin-bottom: 0cm; border: none; padding: 0cm; line-height: 150%\"><span style=\"display: inline-block; border: none; padding: 0cm\"><font style=\"font-size: 11pt\"><span lang=\"de-DE\"><span style=\"color: rgb(38, 38, 44); font-family: Calibri, sans-serif; font-size: 14.6667px;\">Auf der</span><font face=\"Calibri, sans-serif\">&nbsp;</font></span><font face=\"Calibri, sans-serif\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">Fläche\ndes Züblin‐Areals</span></font></span><span lang=\"de-DE\">&nbsp;</span></font></font></span><span style=\"color: rgb(38, 38, 44); font-family: Calibri, sans-serif; font-size: 14.6667px;\">soll für das</span><span lang=\"de-DE\" style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;\">&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">Leonhardsviertel\nund Bohnenviertel eine neue Quartier</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">smitte\nentstehen. </span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">Die</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">\n``Neue Mitte`` </span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">ist</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">\n</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">ein\n</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">Begegnungspunkt\nfür Mensch und Natur</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">.\n</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">Es\nentstehen neue Wohnungen, wie auch Gewerbe- und soziale Flächen. Das\nGartenhaus soll für einen Ort </span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">in\nmitten der Innenstadt</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">\nstehen, an dem es möglich ist, selber zum Gärtner zu werden und der\nsich positiv auf das Stadtklima auswirkt. Hier soll gelebt,\ngegärtnert, </span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">gearbeitet,</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">\n</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">begegnet</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">\nund sich ausgetauscht werden. </span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">Alle\nsozialen Gruppen, wie auch die Tiere sollen von der ``neuen Mitte``\ndurch ein vielfältiges Nutzungs- und Pflanzenangebot profitieren.\nAuch d</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">urch\ndie</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">\nVerwendung von nachhaltigen Materialien und d</span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit; font-variant-numeric: normal; font-variant-east-asian: normal;\"><font color=\"#26262c\"><span lang=\"de-DE\">er\nEinsatz von erneuerbaren Energieressourcen entsteht ein\nverantwortungsbewusster Umgang mit der Umwelt.</span></font></span></p>"
